Este poema es un soneto satírico escrito por Evaristo Silió y Cortés, un poeta español del siglo XIX que era conocido por su humor y su capacidad para la sátira literaria. El poema juega con el doble sentido del apellido "Brabo" y las exclamaciones de "¡Bravo!", burlándose del poeta que cree haber escrito un gran poema, cuando en realidad no es así.
